@Override
public boolean equals(Object o) {
  if (this == o) return true;
  if (!(o instanceof SidedPlane)) return false;
  if (!super.equals(o)) return false;

  SidedPlane that = (SidedPlane) o;

  return Double.compare(that.sigNum, sigNum) == 0;

}

